import React from 'react';
import Link from "next/link";
import Header from "../components/shared/Header";

class Portfolios extends React.Component {
    render() {
        return (
            <div>
            <h1>This page is Portfolios </h1>
        <Header />
        </div>
    )
    }
}
export default Portfolios;
